import{_ as t,o as e,c as r,Q as a}from"./chunks/framework.33544f09.js";const S=JSON.parse('{"title":"What is Spring Cloud AWS?","description":"","frontmatter":{},"headers":[],"relativePath":"what-is-spring-cloud-aws.md","filePath":"what-is-spring-cloud-aws.md"}'),i={name:"what-is-spring-cloud-aws.md"},o=a('<h1 id="what-is-spring-cloud-aws" tabindex="-1">What is Spring Cloud AWS? <a class="header-anchor" href="#what-is-spring-cloud-aws" aria-label="Permalink to &quot;What is Spring Cloud AWS?&quot;">​</a></h1><p>Spring Cloud AWS simplifies using AWS managed services in a Spring and Spring Boot applications.</p><p>For a deep dive into the project, refer to the Spring Cloud AWS documentation:</p><table><thead><tr><th>Version</th><th>Reference Docs</th><th>API Docs</th></tr></thead><tbody><tr><td>Spring Cloud AWS 3.0.3</td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/3.0.3/reference/html/index.html" target="_blank" rel="noreferrer">Reference Docs</a></td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/3.0.3/apidocs/index.html" target="_blank" rel="noreferrer">API Docs</a></td></tr><tr><td>Spring Cloud AWS 2.4.4</td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/2.4.4/reference/html/index.html" target="_blank" rel="noreferrer">Reference Docs</a></td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/2.4.4/apidocs/index.html" target="_blank" rel="noreferrer">API Docs</a></td></tr><tr><td>Spring Cloud AWS 2.3.5</td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/2.3.5/reference/html/index.html" target="_blank" rel="noreferrer">Reference Docs</a></td><td><a href="https://docs.awspring.io/spring-cloud-aws/docs/2.3.5/apidocs/index.html" target="_blank" rel="noreferrer">API Docs</a></td></tr></tbody></table><h2 id="sponsors" tabindex="-1">Sponsors <a class="header-anchor" href="#sponsors" aria-label="Permalink to &quot;Sponsors&quot;">​</a></h2><p>Big thanks to <a href="https://localstack.cloud" target="_blank" rel="noreferrer">LocalStack</a> for providing PRO licenses to the development team!</p><p><a href="https://localstack.cloud"><img src="https://user-images.githubusercontent.com/47351025/215054012-f5af0761-0bd5-49c6-bd3e-c6b2a6844f53.png" height="100"></a></p><h2 id="compatibility-with-spring-project-versions" tabindex="-1">Compatibility with Spring Project Versions <a class="header-anchor" href="#compatibility-with-spring-project-versions" aria-label="Permalink to &quot;Compatibility with Spring Project Versions&quot;">​</a></h2><p>This project has dependency and transitive dependencies on Spring Projects. The table below outlines the versions of Spring Cloud, Spring Boot and Spring Framework versions that are compatible with certain Spring Cloud AWS version.</p><table><thead><tr><th>Spring Cloud AWS</th><th>Spring Cloud</th><th>Spring Boot</th><th>Spring Framework</th><th>AWS Java SDK</th></tr></thead><tbody><tr><td>2.3.x (maintenance mode)</td><td><a href="https://github.com/spring-cloud/spring-cloud-release/wiki/Spring-Cloud-2020.0-Release-Notes" target="_blank" rel="noreferrer">2020.0.x</a> (3.0/Illford)</td><td>2.4.x, 2.5.x</td><td>5.3.x</td><td>1.x</td></tr><tr><td>2.4.x (maintenance mode)</td><td><a href="https://github.com/spring-cloud/spring-cloud-release/wiki/Spring-Cloud-2021.0-Release-Notes" target="_blank" rel="noreferrer">2021.0.x</a> (3.1/Jubilee)</td><td>2.6.x, 2.7.x</td><td>5.3.x</td><td>1.x</td></tr><tr><td>3.0.x</td><td><a href="https://github.com/spring-cloud/spring-cloud-release/wiki/Spring-Cloud-2022.0-Release-Notes" target="_blank" rel="noreferrer">2022.0.x</a> (4.0/Kilburn)</td><td>3.0.x, 3.1.x</td><td>6.0.x</td><td>2.x</td></tr><tr><td>3.1.x</td><td><a href="https://github.com/spring-cloud/spring-cloud-release/wiki/Spring-Cloud-2022.0-Release-Notes" target="_blank" rel="noreferrer">2023.0.x</a> (4.0/Kilburn)</td><td>3.2.x</td><td>6.1.x</td><td>2.x</td></tr></tbody></table><p><strong>Note</strong>: 3.0.0-M2 is the last version compatible with Spring Boot 2.7.x and Spring Cloud 3.1. Starting from 3.0.0-M3, project has switched to Spring Boot 3.0.</p><h2 id="supported-aws-integrations" tabindex="-1">Supported AWS integrations <a class="header-anchor" href="#supported-aws-integrations" aria-label="Permalink to &quot;Supported AWS integrations&quot;">​</a></h2><table><thead><tr><th>AWS Service</th><th>Spring Cloud AWS 3.x</th></tr></thead><tbody><tr><td>S3</td><td>✅</td></tr><tr><td>SNS</td><td>✅</td></tr><tr><td>SES</td><td>✅</td></tr><tr><td>Parameter Store</td><td>✅</td></tr><tr><td>Secrets Manager</td><td>✅</td></tr><tr><td>SQS</td><td>✅</td></tr><tr><td>CloudWatch</td><td>✅</td></tr><tr><td>DynamoDB</td><td>✅</td></tr></tbody></table><p>Note, that Spring provides support for other AWS services in following projects:</p><ul><li><a href="https://github.com/spring-cloud/spring-cloud-stream-binder-aws-kinesis" target="_blank" rel="noreferrer">Spring Cloud Stream Binder AWS Kinesis</a></li><li><a href="https://github.com/spring-cloud/spring-cloud-config" target="_blank" rel="noreferrer">Spring Cloud Config Server</a> supports AWS Parameter Store and Secrets Manager</li><li><a href="https://github.com/spring-projects/spring-integration-aws" target="_blank" rel="noreferrer">Spring Integration for AWS</a></li></ul><h2 id="getting-in-touch" tabindex="-1">Getting in touch <a class="header-anchor" href="#getting-in-touch" aria-label="Permalink to &quot;Getting in touch&quot;">​</a></h2><ul><li><a href="https://github.com/awspring/spring-cloud-aws/discussions" target="_blank" rel="noreferrer">Discussions on Github</a> - the best way to discuss anything Spring Cloud AWS related</li></ul><p>Or reach out directly to individual team members:</p><ul><li>Maciej Walkowiak <a href="https://twitter.com/maciejwalkowiak" target="_blank" rel="noreferrer">Twitter</a></li><li>Matej Nedic <a href="https://twitter.com/MatejNedic1" target="_blank" rel="noreferrer">Twitter</a></li><li>Tomaz Fernandes <a href="https://twitter.com/tomazfernandes_" target="_blank" rel="noreferrer">Twitter</a></li></ul>',19),n=[o];function d(s,l,p,h,c,g){return e(),r("div",null,n)}const f=t(i,[["render",d]]);export{S as __pageData,f as default};
